



update u
set u.connid=-(c.contactid)
from user_accounts u
join contact c
on u.first_name=c.fname
and u.last_name=c.lname
where u.user_id>8125

update user_accounts
set user_type='adoptive_parent'
where user_id>8125

update user_accounts
set status_mode='Active'
,status='Active'
where user_id>8125

update user_accounts
set agency_id=227
where user_id>8125

update user_accounts
set membership=1
where user_id>8125

update user_accounts
set datejoined=getdate()
where user_id>8125

update user_accounts
set airs_contact_id=abs(connid)
where airs_contact_id is NULL